import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

const Navigation = ({ isLoggedIn, onLogout }) => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container">
        <a href="/" className="navbar-brand">BITESPACE</a>
        <div className="collapse navbar-collapse" id="ftco-nav">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item active"><Link to="/" className="nav-link">Home</Link></li>
            <li className="nav-item"><Link to="/about" className="nav-link">About</Link></li>
            <li className="nav-item"><Link to="/gallery" className="nav-link">Gallery</Link></li>

            {/* Conditionally render based on login state */}
            {!isLoggedIn ? (
              <>
                <li className="nav-item"><Link to="/login" className="nav-link">Login</Link></li>
                <li className="nav-item"><Link to="/signup" className="nav-link">Sign Up</Link></li>
              </>
            ) : (
              <li className="nav-item">
                <button onClick={onLogout} className="nav-link btn btn-link">
                  Log Out
                </button>
              </li>
            )}

            <li className="nav-item cta"><Link to="/cart" className="nav-link">Cart</Link></li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navigation;
